import FAQList from "./FAQList";

export default function FAQ() {
  return (
    <section className="self-stretch flex flex-row flex-wrap items-center justify-center gap-[64px] max-w-[1280px] text-left text-lg text-mediumblue font-sub-title mq768:gap-[32px] mq450:gap-[16px]">
      <div id="top" className="flex flex-col w-full items-center gap-[24px]">
        <div
          id="title"
          className="font-palanquin font-regular text-[56px] leading-[100%] tracking-[-4%] mq450:text-[28px]"
        >
          Frequently Asked Questions
        </div>
      </div>
      <FAQList />
    </section>
  );
}
